Mark Watches *Supernatural*, Season 09
----------------------------

Commissioned by his fans to watch Eric Kripke's epic, tragicomical tale of two brothers who criss-cross the US hunting monsters, Mark Oshiro (of Mark Watches, Mark Reads, and Mark Does Stuff fame) takes on the ninth season of the 2005 television series, almost entirely unspoiled. And he is not prepared.

The videos contained herein are of Mark watching and reacting to the series, *NOT* the actual episodes of season nine of *Supernatural*.


